# --- Helper Functions for Graphs ---
def create_time_series_chart(df, axis_type, title):
    fig = px.scatter(df, x='CW', y='Value')
    fig.update_traces(mode='lines+markers')
    fig.update_xaxes(showgrid=False, type='category')
    fig.update_yaxes(type='linear' if axis_type == 'Linear' else 'log')
    fig.add_annotation(x=0, y=0.85, xanchor='left', yanchor='bottom',
                       xref='paper', yref='paper', showarrow=False, align='left',
                       text=title)
    fig.update_layout(height=225, margin={'l': 20, 'b': 30, 'r': 10, 't': 10}, template="plotly_white")
    return fig

# --- Callbacks ---
@app.callback(
    Output('scatter-2d', 'figure'),
    Output('scatter-3d', 'figure'),
    Input('xaxis-column', 'value'),
    Input('yaxis-column', 'value'),
    Input('zaxis-column', 'value'),
    Input('xaxis-type', 'value'),
    Input('yaxis-type', 'value'),
    Input('customer-dropdown', 'value'),
    Input('cw-slider', 'value'),
    Input('waxis-column', 'value'),
    Input('cluster-dropdown', 'value'),
    Input('deviation-slider', 'value'))
def update_scatter_graphs(xaxis_column_name, yaxis_column_name, zaxis_column_name,
                          xaxis_type, yaxis_type, customer_value,
                          cw_value, waxis_column_name, cluster_value, deviation_value):
    dff = processed_df.loc[processed_df['CW'] == cw_value]

    if customer_value != 0:
        dff = dff.loc[dff['Customer'].isin(customer_value)]

    if cluster_value != 'All':
        dff = dff.loc[dff['ClusterCat'].isin(cluster_value)]

    # 2D Scatter Plot
    fig_2d = px.scatter(x=dff[dff['Indicator Name'] == xaxis_column_name]['Value'],
                        y=dff[dff['Indicator Name'] == yaxis_column_name]['Value'],
                        color=dff[dff['Indicator Name'] == waxis_column_name]['Value'],
                        size=dff[dff['Indicator Name'] == waxis_column_name]['Value'],
                        hover_name=dff.loc[processed_df['Indicator Name'] == yaxis_column_name]['Customer'],
                        labels={"color": waxis_column_name})

    fig_2d.update_traces(customdata=dff[dff['Indicator Name'] == yaxis_column_name]['Customer'])
    fig_2d.update_xaxes(title=xaxis_column_name, type='linear' if xaxis_type == 'Linear' else 'log')
    fig_2d.update_yaxes(title=yaxis_column_name, type='linear' if yaxis_type == 'Linear' else 'log')
    fig_2d.update_layout(margin={'l': 40, 'b': 40, 't': 10, 'r': 0}, hovermode='closest', template="plotly_white")

    # 3D Scatter Plot
    fig_3d = px.scatter_3d(x=dff[dff['Indicator Name'] == xaxis_column_name]['Value'],
                           y=dff[dff['Indicator Name'] == yaxis_column_name]['Value'],
                           z=dff[dff['Indicator Name'] == zaxis_column_name]['Value'],
                           color=dff[dff['Indicator Name'] == xaxis_column_name]['ClusterCat'],
                           hover_name=dff[dff['Indicator Name'] == yaxis_column_name]['Customer'],
                           labels={"color": dff[dff['Indicator Name'] == xaxis_column_name]['ClusterCat'].iloc[0]})

    fig_3d.update_traces(customdata=dff[dff['Indicator Name'] == yaxis_column_name]['Customer'])
    fig_3d.update_layout(margin={'l': 40, 'b': 40, 't': 10, 'r': 0}, hovermode='closest', showlegend=True,
                         template="plotly_white")

    return fig_2d, fig_3d

@app.callback(
    Output('time-series-x', 'figure'),
    Output('time-series-y', 'figure'),
    Output('time-series-z', 'figure'),
    Output('time-series-w', 'figure'),
    Input('scatter-2d', 'hoverData'),
    Input('xaxis-column', 'value'),
    Input('yaxis-column', 'value'),
    Input('zaxis-column', 'value'),
    Input('waxis-column', 'value'),
    Input('xaxis-type', 'value'),
    Input('yaxis-type', 'value'))
def update_time_series_graphs(hoverData, xaxis_column_name, yaxis_column_name, zaxis_column_name, waxis_column_name, xaxis_type, yaxis_type):
    if hoverData is None:
        return {}, {}, {}, {}

    customer_name = hoverData['points'][0]['customdata']

    # Filter data for the selected customer
    customer_df = processed_df[processed_df['Customer'] == customer_name]

    # Create charts for each axis
    fig_x = create_time_series_chart(
        customer_df[customer_df['Indicator Name'] == xaxis_column_name],
        xaxis_type,
        f'<b>{customer_name}</b><br>{xaxis_column_name}'
    )

    fig_y = create_time_series_chart(
        customer_df[customer_df['Indicator Name'] == yaxis_column_name],
        yaxis_type,
        f'<b>{customer_name}</b><br>{yaxis_column_name}'
    )

    fig_z = create_time_series_chart(
        customer_df[customer_df['Indicator Name'] == zaxis_column_name],
        yaxis_type,
        f'<b>{customer_name}</b><br>{zaxis_column_name}'
    )

    fig_w = create_time_series_chart(
        customer_df[customer_df['Indicator Name'] == waxis_column_name],
        yaxis_type,
        f'<b>{customer_name}</b><br>{waxis_column_name}'
    )

    return fig_x, fig_y, fig_z, fig_w


